  true,\n\t\"url\": null,\n\t\"notes\": \"Southern Greenland ice sheet elevation change
  estimates are derived from SEASAT and GEOSAT radar altimetry data from 1978 to 1988.
  Data are confined to 61-72 deg N, 30-50 deg W, above 1700 m elevation. The addition
  of GEOSAT Geodetic Mission (GM) data results in twice as many crossover points and
  50% greater coverage than previous studies. Coverage above 2000 m elevation is improved
  to 90%, and about 75% of the area between 1700 m and 2000 m is now covered. Data
  are in ASCII text format, available via FTP, and consist of elevation change rate
  (dH/dt, cm/year) and corresponding error estimates in 50 km grid cells.\",\n\t\"license_title\":
